description:
Babysitter Kayden has snuck her boyfriend Tad thru the back window and is busy giving him a rimmer when Mom gets home earlier than expected! Quick as a bunny, Tad hides in the closet. If he's caught Kayden's screwed! But then, from the closet, Tad sees Mom slobber all over his girl, and to his horror, she returns the favor! Just as Tad thinks he can stand no more, Dad drives up, mom and Kayden unlock tongues, and mom hops into the closet herself so as not to get caught en flagrante. And mom's a total milf, of course, so Tad does what Tad does best...and before you know it, dad and Kayden join the orgy! Hope junior's tucked in... because no one else is!

